#رمضان #فتح #الاجهزة_الامنية_الفلسطينية #عاشت_فلسطين #درع_الوطن #الامن_الوطني #💛 #قوات_الامن_الوطني_الفلسطيني #✌️ #الضفة #طولكرم #الامن_الوقائي

@ele_elna_elak campaign is rocking🔥! Despite all the madness around us! This is how we are responding to death, mass killing, forced starvation and Gaza blockade that the Israeli occupation is applying on Gaza Strip for a year! 
For our people, for Palestine and for the good around the world, we dedicated ourselves to make difference and to make our people’s lives easier during this Genocide, to try face some of the countless hardships and suffering that we are facing for almost a year, 
We will continue working to distribute drinking water to the displacement camps in Gaza Strip, and all we hope now is for this genocide to stop so that we can continue our efforts to help our people and clear the rubble from the face of our beautiful city!
